('2336','2','2136','Whg Corsini',Null,'Mietwohnung mit 4 Schlafzimmer in Sol de Mallorca','32944','ehr gepflegte und großzügige 4 Schlafzimmerwohnungen in ruhiger Wohnlage von Sol de Mallorca. Sol de Mallorca ist eine beliebte Residentenlage im Südwesten von Mallorca.\r\nDie Wohnanlage bietet ein Schwimmbad und Paddletennis Plätze. Über einen 15 minütigen Gehweg erreicht man eine verträumte ruhige Badebucht.\r\nDie Wohnung liegt im 1. OG und bietet auf 177m² Wohnfläche, 4 Schlafzimmer, 3 Badezimmer, Wohnesszimmer und Küche mit Hauswirtschaftsraum.\r\nAlle Räume haben eine Klimaanlage w/k und Gaszentralheizung. Diese sehr elegante Wohnung wird mit hochwertiger Ausstattung und -Möbeln vermietet.\r\n Die Wohnung ist ab 01.09.2015 frei und kann für 11 Monate angemietet werden. Der Mietpreis liegt bei 2.200€ im Monat inkl Gemeinschaftskosten. Strom und Tel gehen zu Lasten des Mieters.\r\n\r\n','32945','2200','106','2015-06-08 12:45:26','106','2015-06-08 12:46:20',Null,'2399','125','1128',1,'1','0',Null,Null,Null,'32946',Null,'0','0','0',Null,'2015-06-08 12:54:54',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'32947',Null,'32948',Null,'32949',Null,'32950','Büro: 914.415.544 (Sekretärin Loli) ldelalamo3@gmail.com Fax 914.412.946','32951','0',0,'4');
